On today's episode of @climbinggold, we talk with @tonde_san and Adam Pustelnik, both of which are at the top of the game when it comes to routesetting for competition climbing. Routesetting is an unseen craft that has a huge impact on a climber's experience and performance. Listen to Episode 6, "Risk, Intensity, Complexity" on Spotify at the link in my bio or where ever you get your podcasts. 

